import React from 'react';

import styles from './ScheduleFrameCol.module.css';





export default ({ col, handleClick }) => {
	if (col) {
		if (col['receptionInfo']) {
			return (
				<td className={styles.col} onClick={() => handleClick()}>
					<div className={styles.date}>
						{col['date']}
					</div>
					<div className={styles.time}>
						{col['receptionInfo']}
					</div>
				</td>
			);
		} else {
			return (
				<td className={styles.colNotAllowed} onClick={() => handleClick()}>
					<div className={styles.date}>
						{col['date']}
					</div>
				</td>
			);
		}
	} else {
			return <td className={styles.colEmpty} ></td>
	}
};
